import react from 'react'

const BackToTop = (props) => {
    return (
        <react.Fragment>
            <div onClick={props.onClick} className='backtotopButton'>
                <div className='buttonIcon'></div>
                <div className='buttonText'></div>
            </div>
            <style jsx>{`
                .backtotopButton {
                    // border: blue solid 1px;
                    color: white;
                    text-align: center;
                    line-height: 45px;

                    background-color: #2E7BC1;
                    height: 40px;
                    width: 140px;

                    margin-top: -50px;
                    margin-bottom: -50px;
                    border-radius: 5px;

                    opacity: 0.9;

                    // position: fixed;
                    // right: 200px;
                    // bottom: 100px;
                }

                .backtotopButton:hover{
                    opacity: 1;
                    cursor: pointer;
                }

                .buttonIcon {
                    height: 100%;
                }

                .buttonText{
                    height:100%;
                }

            `}</style>
        </react.Fragment>
    )
}

export default BackToTop;
